import React, { useEffect } from 'react';

const ReadData = ({ GHI, fetchGHI, onEdit, onDelete }) => {
  useEffect(() => {
    fetchGHI();
  }, [fetchGHI]);

  return (
    <div>
      {GHI.map(getGHI => (
        <div key={`${getGHI.country}-${getGHI.year}`}>
          {`country: ${getGHI.country}, year: ${getGHI.year}, ghi: ${getGHI.ghi}, stunting: ${getGHI.child_stunting}, wasting: ${getGHI.child_wasting}, undernourishment: ${getGHI.undernourishment}, mortality: ${getGHI.child_mortality}`}
          <br />
          <button onClick={() => onEdit(getGHI)}>Edit</button>
          <button onClick={() => onDelete(getGHI.country, getGHI.year)}>Delete</button>
        </div>
      ))}
    </div>
  );
};

export default ReadData;
